In the same sense that it is assigned, it can be displayed the same way with dbg and disp. dbg another_var # 0000
dbg another_var[0] # 0
dbg another_var[NOT(0)..] # 000 disp another_var is {another_var}
disp the least significant bit of another_var is {another_var[0]}
disp the other 3 bits are {another_var[NOT(0)..]}
